(368, 'AN168', 'Countries', 'Countries'),
(369, 'AN169', 'Percent of Visitors', 'Percent of Visitors'),
(370, 'AN170', '&lt;b&gt;No data available&lt;/b&gt;', '&lt;b&gt;No data available&lt;/b&gt;'),
(371, 'AN171', 'Your website is popular on following countries:', 'Your website is popular on following countries:'),
(372, 'AN172', 'End', 'End'),
(373, 'AN173', 'Ideally, your title tag should contain between 10 and 70 characters (spaces included). &lt;br /&gt;\r\nMake sure your title is explicit and contains your most important keywords. &lt;br /&gt;\r\nBe sure that each page has a unique title. &lt;br /&gt;', 'Ideally, your title tag should contain between 10 and 70 characters (spaces included). &lt;br /&gt;\r\nMake sure your title is explicit and contains your most important keywords. &lt;br /&gt;\r\nBe sure that each page has a unique title. &lt;br /&gt;'),
(374, 'AN174', 'Meta descriptions contains between 100 and 300 characters (spaces included). &lt;br /&gt;\r\nIt allow you to influence how your web pages are described and displayed in search results. &lt;br /&gt;\r\nEnsure that all of your web pages have a unique meta description that is explicit and contains your most important keywords (these appear in\r\nbold when they match part or all of the user\'s search query).&lt;br /&gt;\r\nA good meta description acts as an organic advertisement, so use enticing messaging with a clear call to action to maximize click-through rate.&lt;br /&gt;', 'Meta descriptions contains between 100 and 300 characters (spaces included). &lt;br /&gt;\r\nIt allow you to influence how your web pages are described and displayed in search results. &lt;br /&gt;\r\nEnsure that all of your web pages have a unique meta description that is explicit and contains your most important keywords (these appear in\r\nbold when they match part or all of the user\'s search query).&lt;br /&gt;\r\nA good meta description acts as an organic advertisement, so use enticing messaging with a clear call to action to maximize click-through rate.&lt;br /&gt;'),
(375, 'AN175', 'Meta Keywords are a specific type of meta tag that appear in the HTML code \r\nof a Web page and help tell search engines what the topic of the page is.&lt;br /&gt;\r\nHowever, google can\'t use meta keywords.&lt;br /&gt;', 'Meta Keywords are a specific type of meta tag that appear in the HTML code \r\nof a Web page and help tell search engines what the topic of the page is.&lt;br /&gt;\r\nHowever, google can\'t use meta keywords.&lt;br /&gt;'),
(376, 'AN176', 'Use your keywords in the headings and make sure the first level (H1) includes your most important keywords. Never duplicate your title tag content in your header tag.&lt;br /&gt;\r\nWhile it is important to ensure every page has an H1 tag, never include more than one per page. Instead, use multiple H2 - H6 tags.&lt;br /&gt;', 'Use your keywords in the headings and make sure the first level (H1) includes your most important keywords. Never duplicate your title tag content in your header tag.&lt;br /&gt;\r\nWhile it is important to ensure every page has an H1 tag, never include more than one per page. Instead, use multiple H2 - H6 tags.&lt;br /&gt;'),
(377, 'AN177', 'This is an example of what your Title Tag and Meta Description will look like in Google search results.&lt;br /&gt;\r\nWhile Title Tags &amp; Meta Descriptions are used to build the search result listings, the search engines may create their own if they are missing, not well written, or not relevant to the content on the page.&lt;br /&gt;\r\nTitle Tags and Meta Descriptions are cut short if they are too long, so it\'s important to stay within the suggested character limits. &lt;br /&gt;', 'This is an example of what your Title Tag and Meta Description will look like in Google search results.&lt;br /&gt;\r\nWhile Title Tags &amp; Meta Descriptions are used to build the search result listings, the search engines may create their own if they are missing, not well written, or not relevant to the content on the page.&lt;br /&gt;\r\nTitle Tags and Meta Descriptions are cut short if they are too long, so it\'s important to stay within the suggested character limits. &lt;br /&gt;'),
(378, 'AN178', 'Alternative text is used to describe images to give the search engine crawlers (and the visually impaired). &lt;br /&gt;\r\nAlso, more information to help them understand images, which can help them to appear in Google Images search results.&lt;br /&gt;', 'Alternative text is used to describe images to give the search engine crawlers (and the visually impaired). &lt;br /&gt;\r\nAlso, more information to help them understand images, which can help them to appear in Google Images search results.&lt;br /&gt;'),
(379, 'AN179', 'This Keyword Cloud provides an insight into the frequency of keyword usage within the page.&lt;br /&gt;\r\nIt\'s important to carry out keyword research to get an understanding of the keywords that your audience is using. There are a number of keyword research tools available online to help you choose which keywords to target.&lt;br /&gt;', 'This Keyword Cloud provides an insight into the frequency of keyword usage within the page.&lt;br /&gt;\r\nIt\'s important to carry out keyword research to get an understanding of the keywords that your audience is using. There are a number of keyword research tools available online to help you choose which keywords to target.&lt;br /&gt;'),
(380, 'AN180', 'This table highlights the importance of being consistent with your use of keywords. &lt;br /&gt;\r\nTo improve the chance of ranking well in search results for a specific keyword, make sure you include it in some or all of the following: page URL, page content, title tag, meta description, header tags, image alt attributes, internal link anchor text and backlink anchor text.&lt;br /&gt;', 'This table highlights the importance of being consistent with your use of keywords. &lt;br /&gt;\r\nTo improve the chance of ranking well in search results for a specific keyword, make sure you include it in some or all of the following: page URL, page content, title tag, meta description, header tags, image alt attributes, internal link anchor text and backlink anchor text.&lt;br /&gt;'),
(381, 'AN181', 'Code to text ratio represents the percentage of actual text on a web page compared to the percentage of \r\nHTML code, and it is used by search engines to calculate the relevancy of a web page. &lt;br /&gt;\r\nA higher code to text ratio will increase your chances of getting a better rank in search engine results.&lt;br /&gt;', 'Code to text ratio represents the percentage of actual text on a web page compared to the percentage of \r\nHTML code, and it is used by search engines to calculate the relevancy of a web page. &lt;br /&gt;\r\nA higher code to text ratio will increase your chances of getting a better rank in search engine results.&lt;br /&gt;'),
(382, 'AN182', 'Gzip is a method of compressing files (making them smaller) for faster network transfers.&lt;br /&gt;\r\nIt allows to reduce the size of web pages and any other typical web files to about 30% or less of its original size before it transfer.&lt;br /&gt;', 'Gzip is a method of compressing files (making them smaller) for faster network transfers.&lt;br /&gt;\r\nIt allows to reduce the size of web pages and any other typical web files to about 30% or less of its original size before it transfer.&lt;br /&gt;'),
(383, 'AN183', 'Redirecting requests from a non-preferred domain is important because search engines consider URLs with and without &quot;www&quot; as two different websites.', 'Redirecting requests from a non-preferred domain is important because search engines consider URLs with and without &quot;www&quot; as two different websites.'),
(384, 'AN184', 'To check this for your website, enter your IP address in the browser and see if your site loads with the IP address. &lt;br /&gt;\r\nIdeally, the IP should redirect to your website\'s URL or to a page from your website hosting provider.&lt;br /&gt;\r\nIf it does not redirect, you should do an htaccess 301 redirect to make sure the IP does not get indexed.&lt;br /&gt;', 'To check this for your website, enter your IP address in the browser and see if your site loads with the IP address. &lt;br /&gt;\r\nIdeally, the IP should redirect to your website\'s URL or to a page from your website hosting provider.&lt;br /&gt;\r\nIf it does not redirect, you should do an htaccess 301 redirect to make sure the IP does not get indexed.&lt;br /&gt;'),
(385, 'AN185', 'While there\'s no exact limit to the number of links you should include on a page, best practice is to avoid exceeding 200 links.&lt;br /&gt;\r\n\r\nLinks pass value from one page to another, but the amount of value that can be passed is split between all of the links on a page. This means that adding unnecessary links will dilute the potential value attributed to your other links.&lt;br /&gt;\r\n\r\nUsing the Nofollow attribute prevents value from being passed to the linking page, but it\'s worth noting that these links are still taken into account when calculating the value that is passed through each link, so Nofollow links can also dilute pagerank.&lt;br /&gt;', 'While there\'s no exact limit to the number of links you should include on a page, best practice is to avoid exceeding 200 links.&lt;br /&gt;\r\n\r\nLinks pass value from one page to another, but the amount of value that can be passed is split between all of the links on a page. This means that adding unnecessary links will dilute the potential value attributed to your other links.&lt;br /&gt;\r\n\r\nUsing the Nofollow attribute prevents value from being passed to the linking page, but it\'s worth noting that these links are still taken into account when calculating the value that is passed through each link, so Nofollow links can also dilute pagerank.&lt;br /&gt;'),
(386, 'AN186', 'Broken links send users to non-existing web pages. They are bad for your site\'s usability, reputation and SEO. If you find broken links in the future, take the time to replace or remove each one. &lt;br /&gt;', 'Broken links send users to non-existing web pages. They are bad for your site\'s usability, reputation and SEO. If you find broken links in the future, take the time to replace or remove each one. &lt;br /&gt;'),
(387, 'AN187', 'A robots.txt file allows you to restrict the access of search engine robots that crawl the web and it can prevent these robots from accessing specific directories and pages. It also specifies where the XML sitemap file is located.&lt;br /&gt;\r\nYou can check for errors in your robots.txt file using Google Search Console (formerly Webmaster Tools) by selecting \'Robots.txt Tester\' under \'Crawl\'. This also allows you to test individual pages to make sure that Googlebot has the appropriate access.&lt;br /&gt;', 'A robots.txt file allows you to restrict the access of search engine robots that crawl the web and it can prevent these robots from accessing specific directories and pages. It also specifies where the XML sitemap file is located.&lt;br /&gt;\r\nYou can check for errors in your robots.txt file using Google Search Console (formerly Webmaster Tools) by selecting \'Robots.txt Tester\' under \'Crawl\'. This also allows you to test individual pages to make sure that Googlebot has the appropriate access.&lt;br /&gt;'),
(388, 'AN188', 'A sitemap lists URLs that are available for crawling and can include additional information like your site\'s latest updates, frequency of changes and importance of the URLs. This allows search engines to crawl the site more intelligently.&lt;br /&gt;\r\nWe recommend that you generate an XML sitemap for your website and submit it to both Google Search Console and Bing Webmaster Tools. It is also good practice to specify your sitemap\'s location in your robots.txt file.&lt;br /&gt;', 'A sitemap lists URLs that are available for crawling and can include additional information like your site\'s latest updates, frequency of changes and importance of the URLs. This allows search engines to crawl the site more intelligently.&lt;br /&gt;\r\nWe recommend that you generate an XML sitemap for your website and submit it to both Google Search Console and Bing Webmaster Tools. It is also good practice to specify your sitemap\'s location in your robots.txt file.&lt;br /&gt;'),
(389, 'AN189', 'Your site\'s URLs contain unnecessary elements that make them look complicated. &lt;br /&gt;\r\nA URL must be easy to read and remember for users. Search engines need URLs to be clean and include your page\'s most important keywords. &lt;br /&gt;\r\nClean URLs are also useful when shared on social media as they explain the page\'s content.&lt;br /&gt;', 'Your site\'s URLs contain unnecessary elements that make them look complicated. &lt;br /&gt;\r\nA URL must be easy to read and remember for users. Search engines need URLs to be clean and include your page\'s most important keywords. &lt;br /&gt;\r\nClean URLs are also useful when shared on social media as they explain the page\'s content.&lt;br /&gt;'),
(390, 'AN190', 'Great, you are not using ?underscores (these_are_underscores) in your URLs.&lt;br /&gt;\r\nWhile Google treats hyphens as word separators, it does not for underscores.&lt;br /&gt;', 'Great, you are not using ?underscores (these_are_underscores) in your URLs.&lt;br /&gt;\r\nWhile Google treats hyphens as word separators, it does not for underscores.&lt;br /&gt;'),
(391, 'AN191', 'Embedded Objects such as Flash. It should only be used for specific enhancements. &lt;br /&gt;\r\nAlthough Flash content often looks nicer, it cannot be properly indexed by search engines. &lt;br /&gt;\r\nAvoid full Flash websites to maximize SEO.&lt;br /&gt;', 'Embedded Objects such as Flash. It should only be used for specific enhancements. &lt;br /&gt;\r\nAlthough Flash content often looks nicer, it cannot be properly indexed by search engines. &lt;br /&gt;\r\nAvoid full Flash websites to maximize SEO.&lt;br /&gt;'),
(392, 'AN192', 'Frames can cause problems on your web page because search engines will not crawl or index the content within them. &lt;br /&gt;\r\nAvoid frames whenever possible and use a NoFrames tag if you must use them.&lt;br /&gt;', 'Frames can cause problems on your web page because search engines will not crawl or index the content within them. &lt;br /&gt;\r\nAvoid frames whenever possible and use a NoFrames tag if you must use them.&lt;br /&gt;'),
(393, 'AN193', 'Domain age matters to a certain extent and newer domains generally struggle to get indexed and rank high in search results for their first few months (depending on other associated ranking factors). Consider buying a second-hand domain name.&lt;br /&gt; \r\nDo you know that you can register your domain for up to 10 years? By doing so, you will show the world that you are serious about your business. &lt;br /&gt;', 'Domain age matters to a certain extent and newer domains generally struggle to get indexed and rank high in search results for their first few months (depending on other associated ranking factors). Consider buying a second-hand domain name.&lt;br /&gt; \r\nDo you know that you can register your domain for up to 10 years? By doing so, you will show the world that you are serious about your business. &lt;br /&gt;'),
(394, 'AN194', 'WhoIs domain information can help you determine the proper contact for any domain listed in the Whois database. &lt;br /&gt;\r\nA WhoIs lookup identifies the administrator contact information, billing contact and the technical contact for each domain name listing or IP in the WhoIs database. &lt;br /&gt;', 'WhoIs domain information can help you determine the proper contact for any domain listed in the Whois database. &lt;br /&gt;\r\nA WhoIs lookup identifies the administrator contact information, billing contact and the technical contact for each domain name listing or IP in the WhoIs database. &lt;br /&gt;'),
(395, 'AN195', 'Mobile Friendliness refers to the usability aspects of your mobile website, which Google uses as a ranking signal in mobile search results. &lt;br /&gt;', 'Mobile Friendliness refers to the usability aspects of your mobile website, which Google uses as a ranking signal in mobile search results. &lt;br /&gt;'),
(396, 'AN196', 'The number of people using the Mobile Web is huge; over 75 percent of consumers have access to smartphones. ??&lt;br /&gt;\r\nYour website should look nice on the most popular mobile devices.&lt;br /&gt;\r\n\r\nTip: Use an analytics tool to track mobile usage of your website.&lt;br /&gt;', 'The number of people using the Mobile Web is huge; over 75 percent of consumers have access to smartphones. ??&lt;br /&gt;\r\nYour website should look nice on the most popular mobile devices.&lt;br /&gt;\r\n\r\nTip: Use an analytics tool to track mobile usage of your website.&lt;br /&gt;'),
(397, 'AN197', 'Embedded Objects such as Flash, Silverlight or Java. It should only be used for specific enhancements. &lt;br /&gt;\r\nBut avoid using Embedded Objects, so your content can be accessed on all devices. &lt;br /&gt;', 'Embedded Objects such as Flash, Silverlight or Java. It should only be used for specific enhancements. &lt;br /&gt;\r\nBut avoid using Embedded Objects, so your content can be accessed on all devices. &lt;br /&gt;'),
(398, 'AN198', 'Keep your URLs short and avoid long domain names when possible. &lt;br /&gt;\r\n\r\nA descriptive URL is better recognized by search engines. &lt;br /&gt; A user should be able to look at the address bar and make an accurate guess about the content of the page before reaching it \r\n(e.g., http://www.mysite.com/en/products). &lt;br /&gt;', 'Keep your URLs short and avoid long domain names when possible. &lt;br /&gt;\r\n\r\nA descriptive URL is better recognized by search engines. &lt;br /&gt; A user should be able to look at the address bar and make an accurate guess about the content of the page before reaching it \r\n(e.g., http://www.mysite.com/en/products). &lt;br /&gt;'),
(399, 'AN199', 'Favicons improve a brand\'s visibility. &lt;br /&gt;\r\nAs a favicon is especially important for users bookmarking your website, make sure it is consistent with your brand.&lt;br /&gt;', 'Favicons improve a brand\'s visibility. &lt;br /&gt;\r\nAs a favicon is especially important for users bookmarking your website, make sure it is consistent with your brand.&lt;br /&gt;'),
(400, 'AN200', 'When a visitor encounters a 404 File Not Found error on your site, you\'re on the verge of losing the visitor that you\'ve worked so hard to obtain through the search engines and third party links. &lt;br /&gt;\r\nCreating your custom 404 error page allows you to minimize the number of visitors lost that way.&lt;br /&gt;', 'When a visitor encounters a 404 File Not Found error on your site, you\'re on the verge of losing the visitor that you\'ve worked so hard to obtain through the search engines and third party links. &lt;br /&gt;\r\nCreating your custom 404 error page allows you to minimize the number of visitors lost that way.&lt;br /&gt;');
INSERT INTO `lang` (`id`, `code`, `default_text`, `en`) VALUES
(401, 'AN201', 'Two of the main reasons for an increase in page size are images and JavaScript files.&lt;br /&gt;\r\n\r\nPage size affects the speed of your website; try to keep your page size below 2 Mb.&lt;br /&gt;\r\n\r\nTip: Use images with a small size and optimize their download with gzip.&lt;br /&gt;', 'Two of the main reasons for an increase in page size are images and JavaScript files.&lt;br /&gt;\r\n\r\nPage size affects the speed of your website; try to keep your page size below 2 Mb.&lt;br /&gt;\r\n\r\nTip: Use images with a small size and optimize their download with gzip.&lt;br /&gt;'),
(402, 'AN202', 'Site speed is an important factor for ranking high in Google search results and enriching the user experience.&lt;br /&gt;\r\n\r\nResources: Check out Google\'s developer tutorials for tips on how to to make your website run faster.&lt;br /&gt;', 'Site speed is an important factor for ranking high in Google search results and enriching the user experience.&lt;br /&gt;\r\n\r\nResources: Check out Google\'s developer tutorials for tips on how to to make your website run faster.&lt;br /&gt;'),
(403, 'AN203', 'Make sure your declared language is the same as the language detected by Google&lt;br /&gt;\r\nAlso, define the language of the content in each page\'s HTML code.&lt;br /&gt;', 'Make sure your declared language is the same as the language detected by Google&lt;br /&gt;\r\nAlso, define the language of the content in each page\'s HTML code.&lt;br /&gt;'),
(404, 'AN204', 'Register the various extensions of your domain to protect your brand from cybersquatters.&lt;br /&gt;', 'Register the various extensions of your domain to protect your brand from cybersquatters.&lt;br /&gt;'),
(405, 'AN205', 'Register the various typos of your domain to protect your brand from cybersquatters.&lt;br /&gt;', 'Register the various typos of your domain to protect your brand from cybersquatters.&lt;br /&gt;'),
(406, 'AN206', 'We don\'t recommend adding plain text/linked email addresses to your webpages. &lt;br /&gt;\r\nAs malicious bots scrape the web in search of email addresses to spam. Instead, consider using a contact form.&lt;br /&gt;', 'We don\'t recommend adding plain text/linked email addresses to your webpages. &lt;br /&gt;\r\nAs malicious bots scrape the web in search of email addresses to spam. Instead, consider using a contact form.&lt;br /&gt;'),
(407, 'AN207', 'Safe Browsing to identify unsafe websites and notify users and webmasters so they can protect themselves from harm.\r\n&lt;br /&gt;', 'Safe Browsing to identify unsafe websites and notify users and webmasters so they can protect themselves from harm.\r\n&lt;br /&gt;'),
(408, 'AN208', 'Your server\'s IP address has little impact on your SEO. Nevertheless, try to host your website on a server which is geographically close to your visitors. &lt;br /&gt;\r\nSearch engines take the geolocation of a server into account as well as the server speed. &lt;br /&gt;', 'Your server\'s IP address has little impact on your SEO. Nevertheless, try to host your website on a server which is geographically close to your visitors. &lt;br /&gt;\r\nSearch engines take the geolocation of a server into account as well as the server speed. &lt;br /&gt;'),
(409, 'AN209', 'Website speed has a huge impact on performance, affecting user experience, conversion rates and even rankings. &lt;br /&gt;\r\n???By reducing page load-times, users are less likely to get distracted and the search engines are more likely to reward you by ranking your pages higher in the SERPs.&lt;br /&gt;\r\nConversion rates are far higher for websites that load faster than their slower competitors.&lt;br /&gt;', 'Website speed has a huge impact on performance, affecting user experience, conversion rates and even rankings. &lt;br /&gt;\r\n???By reducing page load-times, users are less likely to get distracted and the search engines are more likely to reward you by ranking your pages higher in the SERPs.&lt;br /&gt;\r\nConversion rates are far higher for websites that load faster than their slower competitors.&lt;br /&gt;'),
(410, 'AN210', 'Web analytics let you measure visitor activity on your website. &lt;br /&gt;\r\nYou should have at least one analytics tool installed, but It can also be good to install a second in order to cross-check the data.&lt;br /&gt;', 'Web analytics let you measure visitor activity on your website. &lt;br /&gt;\r\nYou should have at least one analytics tool installed, but It can also be good to install a second in order to cross-check the data.&lt;br /&gt;'),
(411, 'AN211', 'W3Cis a consortium that sets web standards.&lt;br /&gt;\r\n\r\nUsing valid markup that contains no errors is important because syntax errors can make your page difficult for search engines to index. Run the W3C validation service whenever changes are made to your website\'s code.&lt;br /&gt;', 'W3Cis a consortium that sets web standards.&lt;br /&gt;\r\n\r\nUsing valid markup that contains no errors is important because syntax errors can make your page difficult for search engines to index. Run the W3C validation service whenever changes are made to your website\'s code.&lt;br /&gt;'),
(412, 'AN212', 'The Doctype is used to instruct web browsers about the document type being used. &lt;br /&gt;\r\nFor example, what version of HTML the page is written in.&lt;br /&gt;\r\n\r\nDeclaring a doctype helps web browsers to render content correctly.&lt;br /&gt;', 'The Doctype is used to instruct web browsers about the document type being used. &lt;br /&gt;\r\nFor example, what version of HTML the page is written in.&lt;br /&gt;\r\n\r\nDeclaring a doctype helps web browsers to render content correctly.&lt;br /&gt;'),
(413, 'AN213', 'Specifying language/character encoding can prevent problems with the rendering of special characters.&lt;br /&gt;', 'Specifying language/character encoding can prevent problems with the rendering of special characters.&lt;br /&gt;'),
(414, 'AN214', 'This is the number of pages that we have discovered on your website.&lt;br /&gt;\r\n\r\nA low number can indicate that bots are unable to discover your webpages, which is a common cause of a bad site architecture &amp; internal linking, or you\'re unknowingly preventing bots and search engines from crawling &amp; indexing your pages.&lt;br /&gt;', 'This is the number of pages that we have discovered on your website.&lt;br /&gt;\r\n\r\nA low number can indicate that bots are unable to discover your webpages, which is a common cause of a bad site architecture &amp; internal linking, or you\'re unknowingly preventing bots and search engines from crawling &amp; indexing your pages.&lt;br /&gt;'),
(415, 'AN215', 'Backlinks are links that point to your website from other websites. They are like letters of recommendation for your site.&lt;br /&gt;\r\n\r\nSince this factor is crucial to SEO, you should have a strategy to improve the quantity and quality of backlinks.&lt;br /&gt;', 'Backlinks are links that point to your website from other websites. They are like letters of recommendation for your site.&lt;br /&gt;\r\n\r\nSince this factor is crucial to SEO, you should have a strategy to improve the quantity and quality of backlinks.&lt;br /&gt;'),
(416, 'AN216', 'Social data refers to data individuals create that is knowingly and voluntarily shared by them. &lt;br /&gt;\r\nCost and overhead previously rendered this semi-public form of communication unfeasible.&lt;br /&gt;\r\nBut advances in social networking technology from 2004-2010 has made broader concepts of sharing possible.&lt;br /&gt;', 'Social data refers to data individuals create that is knowingly and voluntarily shared by them. &lt;br /&gt;\r\nCost and overhead previously rendered this semi-public form of communication unfeasible.&lt;br /&gt;\r\nBut advances in social networking technology from 2004-2010 has made broader concepts of sharing possible.&lt;br /&gt;'),
(417, 'AN217', 'Just a estimated worth of your website based on Alexa Rank.&lt;br /&gt;', 'Just a estimated worth of your website based on Alexa Rank.&lt;br /&gt;'),
(418, 'AN218', 'A low rank means that your website gets a lot of visitors. &lt;br /&gt;\r\n\r\nYour Alexa Rank is a good estimate of the worldwide traffic to your website, although it is not 100 percent accurate.&lt;br /&gt;', 'A low rank means that your website gets a lot of visitors. &lt;br /&gt;\r\n\r\nYour Alexa Rank is a good estimate of the worldwide traffic to your website, although it is not 100 percent accurate.&lt;br /&gt;'),
(419, 'AN219', 'We recommend that you book the domain names for the countries where your ??website is popular. &lt;br /&gt;\r\nThis will prevent potential competitors from registering these domains and taking advantage of your reputation in such countries.&lt;br /&gt;', 'We recommend that you book the domain names for the countries where your ??website is popular. &lt;br /&gt;\r\nThis will prevent potential competitors from registering these domains and taking advantage of your reputation in such countries.&lt;br /&gt;'),
