(6, 'page', '7', '05/06/2017 12:00 AM', '{{lang[220]}}', '', '', '{{lang[220]}}', '&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;span style=&quot;color:#ff0000&quot;&gt;&lt;strong&gt;[Please edit this page. Goto Admin Panel -&amp;gt; Pages]&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;strong&gt;Terms &amp;amp; Conditions&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;Please read these Terms and Conditions (&amp;ldquo;Agreement&amp;rdquo;, &amp;ldquo;Terms and Conditions&amp;rdquo;) carefully before using http://www.prothemes.biz (&amp;ldquo;the Site&amp;rdquo;) operated by Rainbow Networks (&amp;ldquo;us&amp;rdquo;, &amp;ldquo;we&amp;rdquo;, or &amp;ldquo;our&amp;rdquo;). This Agreement sets forth the legally binding terms and conditions for your use of the Site at http://www.prothemes.biz.&lt;br /&gt;\r\nBy accessing or using the Site in any manner, including, but not limited to, visiting or browsing the Site or contributing content or other materials to the Site, you agree to be bound by these Terms and Conditions. Capitalized terms are defined in this Agreement.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;strong&gt;Intellectual Property&lt;/strong&gt;&lt;br /&gt;\r\nThe Site and its original content, features and functionality are owned by ProThemes.Biz Team and are protected by international copyright, trademark, patent, trade secret and other intellectual property or proprietary rights laws.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;strong&gt;Termination&lt;/strong&gt;&lt;br /&gt;\r\nWe may terminate your access to the Site, without cause or notice, which may result in the forfeiture and destruction of all information associated with you. All provisions of this Agreement that by their nature should survive termination shall survive termination, including, without limitation, ownership provisions, warranty disclaimers, indemnity, and limitations of liability.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;strong&gt;Links To Other Sites&lt;/strong&gt;&lt;br /&gt;\r\nOur Site may contain links to third-party sites that are not owned or controlled by ProThemes.Biz Team.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;ProThemes.Biz has no control over, and assumes no responsibility for, the content, privacy policies, or practices of any third party sites or services. We strongly advise you to read the terms and conditions and privacy policy of any third-party site that you visit.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;strong&gt;Refund Policy&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;Due to the nature of products we sell (i.e. digitally downloadable products) we are unable to provide refunds under any circumstances. This is because once purchased, you will have access to the files we charge for.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;strong&gt;Changes To This Agreement&lt;/strong&gt;&lt;br /&gt;\r\nWe reserve the right, at our sole discretion, to modify or replace these Terms and Conditions by posting the updated terms on the Site. Your continued use of the Site after any such changes constitutes your acceptance of the new Terms and Conditions.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;Please review this Agreement periodically for changes. If you do not agree to any of this Agreement or any changes to this Agreement, do not use, access or continue to access the Site or discontinue any use of the Site immediately.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:13px&quot;&gt;&lt;span style=&quot;font-family:arial,helvetica,sans-serif&quot;&gt;&lt;strong&gt;Contact Us&lt;/strong&gt;&lt;br /&gt;\r\nIf you have any questions about this Agreement, please contact us.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', '', 'on', 'terms-and-conditions', 'all', 'on', 'all'),
(7, 'page', '8', '05/06/2017 12:00 AM', '{{lang[221]}}', '', '', '{{lang[221]}}', '&lt;p&gt;&lt;strong&gt;Privacy Policy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;The terms of our Privacy Policy shall govern any and all dealings between You (the Customer) and Us (ProThemes.Biz). We agree to be bound by this Privacy Policy in order to ensure that you, as a buyer, can deal with us with confidence.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Personal identification information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We may collect personal identification information from Users in a variety of ways, including, but not limited to, when Users visit our site, register on the site, place an order, subscribe to the newsletter, fill out a form, and in connection with other activities, services, features or resources we make available on our Site. Users may be asked for, as appropriate, name, email address, mailing address, phone number. Users may, however, visit our Site anonymously. We will collect personal identification information from Users only if they voluntarily submit such information to us. Users can always refuse to supply personally identification information, except that it may prevent them from engaging in certain Site related activities.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Non-personal identification information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We may collect non-personal identification information about Users whenever they interact with our Site. Non-personal identification information may include the browser name, the type of computer and technical information about Users means of connection to our Site, such as the operating system and the Internet service providers utilized and other similar information.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Web browser cookies&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Our Site may use &amp;ldquo;cookies&amp;rdquo; to enhance User experience. User&amp;rsquo;s web browser places cookies on their hard drive for record-keeping purposes and sometimes to track information about them. User may choose to set their web browser to refuse cookies, or to alert you when cookies are being sent. If they do so, note that some parts of the Site may not function properly.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;How we use collected information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We may collect and use Users personal information for the following purposes:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;em&gt;- To improve customer service&lt;/em&gt;&lt;br /&gt;\r\n	Information you provide helps us respond to your customer service requests and support needs more efficiently.&lt;/li&gt;\r\n	&lt;li&gt;&lt;em&gt;- To personalize user experience&lt;/em&gt;&lt;br /&gt;\r\n	We may use information in the aggregate to understand how our Users as a group use the services and resources provided on our Site.&lt;/li&gt;\r\n	&lt;li&gt;&lt;em&gt;- To improve our Site&lt;/em&gt;&lt;br /&gt;\r\n	We may use feedback you provide to improve our products and services.&lt;/li&gt;\r\n	&lt;li&gt;&lt;em&gt;- To process payments&lt;/em&gt;&lt;br /&gt;\r\n	We may use the information Users provide about themselves when placing an order only to provide service to that order. We do not share this information with outside parties except to the extent necessary to provide the service.&lt;/li&gt;\r\n	&lt;li&gt;&lt;em&gt;- To run a promotion, contest, survey or other Site feature&lt;/em&gt;&lt;br /&gt;\r\n	To send Users information they agreed to receive about topics we think will be of interest to them.&lt;/li&gt;\r\n	&lt;li&gt;&lt;em&gt;- To send periodic emails&lt;/em&gt;&lt;br /&gt;\r\n	We may use the email address to send User information and updates pertaining to their order. It may also be used to respond to their inquiries, questions, and/or other requests. If User decides to opt-in to our mailing list, they will receive emails that may include company news, updates, related product or service information, etc. If at any time the User would like to unsubscribe from receiving future emails, we include detailed unsubscribe instructions at the bottom of each email.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;How we protect your information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We adopt appropriate data collection, storage and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of your personal information, username, password, transaction information and data stored on our Site.&lt;/p&gt;\r\n\r\n&lt;p&gt;Sensitive and private data exchange between the Site and its Users happens over a SSL secured communication channel and is encrypted and protected with digital signatures. Our Site is also in compliance with PCI vulnerability standards in order to create as secure of an environment as possible for Users.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Sharing your personal information&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We do not sell, trade, or rent Users personal identification information to others. We may share generic aggregated demographic information not linked to any personal identification information regarding visitors and users with our business partners, trusted affiliates and advertisers for the purposes outlined above.We may use third party service providers to help us operate our business and the Site or administer activities on our behalf, such as sending out newsletters or surveys. We may share your information with these third parties for those limited purposes provided that you have given us your permission.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Third party websites&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Users may find advertising or other content on our Site that link to the sites and services of our partners, suppliers, advertisers, sponsors, licensors and other third parties. We do not control the content or links that appear on these sites and are not responsible for the practices employed by websites linked to or from our Site. In addition, these sites or services, including their content and links, may be constantly changing. These sites and services may have their own privacy policies and customer service policies. Browsing and interaction on any other website, including websites which have a link to our Site, is subject to that website&amp;rsquo;s own terms and policies.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Changes to this privacy policy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;ProThemes.Biz has the discretion to update this privacy policy at any time. When we do, we will revise the updated date at the bottom of this page. We encourage Users to frequently check this page for any changes to stay informed about how we are helping to protect the personal information we collect. You acknowledge and agree that it is your responsibility to review this privacy policy periodically and become aware of modifications.&lt;/p&gt;', '', 'on', 'privacy-policy', 'all', 'on', 'all'),
